import styled from 'styled-components'

const tasks = [
    {
        text : 'Hello',
        id: 1
    },
    {
        text : 'Hi',
        id: 2
    },
]

const Task = () => {
    return (
        <Container>
            {tasks.map((task) => (
            <h3 key = {tasks.id}> {tasks.text} </h3>
            ))}

        </Container> 
    )
}

export default Task

const Container = styled.div`
    width: 100%;
    height: 60px;       
    display: flex;
    background-color: #ECEBBD;
    margin-bottom: 5px;
`
